<div class="hint-container info">
<p class="hint-container-title">提示</p>
<p>仓库名称必须严格按照 <code>[你的GitHub用户名].github.io</code> 格式来</p>
<p>否则会将网站部署到以仓库名称命名的子路径上</p>
</div>
